           font : {
              family: 'Arial',
              size : 16,
              color : 'black'
           },
           showarrow : false,
           clicktoshow  : 'onout'
        };
        layout.annotations.push(result, result2);
      }
      var config = {responsive: true,
                    displaylogo: false};
      Plotly.newPlot('Fluid Pressure', data, layout, config);
    </script>
